import React, { Component } from 'react'
import { Header, Menu, Button } from 'semantic-ui-react'

import logo from './logo.svg'

export class Navbar extends Component {
  render() {
    return (
      <Menu borderless>
        <Menu.Item href={`/`}>
          <img src={logo} alt='southendsolutions.com' />
        </Menu.Item>
        <Menu.Item href={`/`} content=<SouthendSolutionsHeader/>/>
      </Menu>
    )
  }
}

export class SouthendSolutionsHeader extends Component {
  render(){
    return(
        <Header as='h3' textAlign='left'>southendsolutions.com</Header>
    )
  }
}
